/*Table structure for table `ultima_posicion` */

DROP TABLE IF EXISTS `ultima_posicion`;

CREATE TABLE `ultima_posicion` (
  `IdReporte` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `Mensaje_IdDispositivo` int(30) NOT NULL,
  `Mensaje_FechaGPS` datetime NOT NULL,
  `Mensaje_FechaServidor` datetime NOT NULL,
  `Mensaje_Velocidad` decimal(18,2) DEFAULT 0.00,
  `Mensaje_Latitud` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0',
  `Mensaje_Longitud` varchar(50) COLLATE utf8_unicode_ci DEFAULT '0',
  `Mensaje_Evento` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Mensaje_Completo` varchar(1000) COLLATE utf8_unicode_ci NOT NULL,
  `Mensaje_Puerto` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Mensaje_PC` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Mensaje_Alerta` int(11) DEFAULT 0,
  `Mensaje_NroMensaje` varchar(45) COLLATE utf8_unicode_ci DEFAULT NULL,
  `Mensaje_Direccion` varchar(400) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`Mensaje_IdDispositivo`),
  UNIQUE KEY `id` (`IdReporte`),
  KEY `id_disp` (`Mensaje_IdDispositivo`),
  KEY `fecha1` (`Mensaje_FechaServidor`),
  KEY `fecha2` (`Mensaje_FechaGPS`),
  KEY `puerto` (`Mensaje_Puerto`),
  KEY `IX_ultimaPoscion_PC` (`Mensaje_PC`),
  KEY `IX_ultimapos_id_fecha` (`Mensaje_IdDispositivo`,`Mensaje_FechaGPS`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `ultima_posicion` */

